it.samples.helpers.PetStoreClient;
import io.apicurio.datamodels.openapi.models.OasDocument;
import io.apicurio.datamodels.openapi.v2.models.Oas20Document;
import io.apicurio.datamodels.openapi.v3.models.Oas30Document;

/**
 * @author eric.wittmann@gmail.com
 */
public class ValidateDocumentCommand extends AbstractCommand {

    public void execute(PetStoreClient petstore) throws Exception {
        OasDocument doc = petstore.getDocument();
        if (doc instanceof Oas20Document) {
            Oas20Document doc20 = (Oas20Document) doc;
            petstore.validate20Document(doc20);
        } else if (doc instanceof Oas30Document) {
            Oas30Document doc30 = (Oas30Document) doc;
            petstore.validate30Document(doc30);
        }
    }

}

#include <iostream>
#include <string>

using namespace std;

int main()
{
 string s;
 cin >> s;
  int n = s.length();
  int count = 0;
  for (int i = 0; i < n; i++)
 {
  if (s[i] == 'a')
 count++;
 }
 if (count > (n / 2))
  cout << n << endl;
  else
  cout << (2 * count - 1) << endl;
  return 0;
}

