import com.example.android.bakingapp.R;
import com.example.android.bakingapp.model.Step;
import com.example.android.bakingapp.ui.StepDetailActivity;
import com.example.android.bakingapp.ui.StepDetailFragment;
import com.example.android.bakingapp.utils.BakingUtils;

import java.util.List;

import butterknife.BindView;
import butterknife.ButterKnife;

/**
 * Created by Zsolt on 03.04.2018.
 */

public class StepAdapter extends RecyclerView.Adapter<StepAdapter.StepViewHolder> {

    private List<Step> mSteps;
    private Context mContext;
    private boolean mTwoPane;

    public StepAdapter(Context context, List<Step> steps, boolean twoPane) {
        mContext = context;
        mSteps = steps;
        mTwoPane = twoPane;
    }

    @Override
    public StepViewHolder onCreateViewHolder(ViewGroup parent, int viewType) {
        View view = LayoutInflater.from(mContext).inflate(R.layout.step_list_item, parent, false);
        return new StepViewHolder(view);
    }

    @Override
    public void onBindViewHolder(StepViewHolder holder, int position) {
        Step step = mSteps.get(position);
        holder.mStepNumberTextView.setText(BakingUtils.getStepNumber(mContext, position));
        holder.mStepShortDescriptionTextView.setText(step.getShortDescription());
        if (step.getVideoURL().isEmpty()) {
            holder.mStepVideoImageView.setVisibility(View.GONE);
        }
    }

    @Override
    public int getItemCount() {
        return mSteps.size();
    }

    public class StepViewHolder extends RecyclerView.ViewHolder implements View.OnClickListener {

        @BindView(R.id.tv_step_number)
        TextView mStepNumberTextView;
        @BindView(R.id.tv_step_short_description)
        TextView mStepShortDescriptionTextView;
        @BindView(R.id.iv_step_video)
        ImageView mStepVideoImageView;

        public StepViewHolder(View itemView) {
            super(itemView);
            ButterKnife.bind(this, itemView);
            itemView.setOnClickListener(this);
        }

        @Override
        public void onClick(View view) {
            int position = getAdapterPosition();
            Step step = mSteps.get(position);
            if (mTwoPane) {
                Bundle arguments = new Bundle();
                arguments.putParcelable(StepDetailFragment.ARG_STEP, step);
                StepDetailFragment fragment = new StepDetailFragment();
                fragment.setArguments(arguments);
                ((FragmentActivity) mContext).getSupportFragmentManager().beginTransaction()
                        .replace(R.id.step_detail_container, fragment)
                        .commit();
            } else {
                Intent intent = new Intent(mContext, StepDetailActivity.class);
                intent.putExtra(StepDetailFragment.ARG_STEP, step);
                mContext.startActivity(intent);
            }
        }
    }
}

