import scala.language.higherKinds

import cats.{Applicative, Functor, Monad, Monoid, Traverse}
import cats.data.{NonEmptyList, Validated, ValidatedNel}
import cats.implicits._

import shapeless._
import shapeless.ops.hlist.{LeftFolder, RightFolder, ToTraversable}

/**
  * A typeclass for folding an HList of [[Validated]]s into a single [[Validated]].
  *
  * @tparam F The type of the [[Validated]]s.
  * @tparam M The type of the monoid used to combine the [[Validated]]s.
  */
trait ValidatedFold[F[_], M] {
  def fold[L <: HList](l: L)(implicit
      toTraversable: ToTraversable.Aux[L, List, F[Validated[M, ?]]]
  ): F[Validated[M, L]]
}

object ValidatedFold {
  def apply[F[_], M](implicit ev: ValidatedFold[F, M]): ValidatedFold[F, M] = ev

  implicit def validatedFold[F[_], M](implicit
      F: Monad[F],
      M: Monoid[M]
  ): ValidatedFold[F, M] = new ValidatedFold[F, M] {
    def fold[L <: HList](l: L)(implicit
        toTraversable: ToTraversable.Aux[L, List, F[Validated[M, ?]]]
    ): F[Validated[M, L]] =
      l.toList.traverse(_.map(_.pure[F]))
        .map(_.sequence)
        .map(_.map(_.foldLeft(M.empty)(_ /+/ _)))
        .map(_.map(_.map(l.foldLeft(_)((acc, v) => v :: acc))))
  }

  implicit def validatedFoldNel[F[_], M](implicit
      F: Monad[F],
      M: Monoid[M]
  ): ValidatedFold[F, NonEmptyList[M]] = new ValidatedFold[F, NonEmptyList[M]] {
    def fold[L <: HList](l: L)(implicit
        toTraversable: ToTraversable.Aux[L, List, F[Validated[NonEmptyList[M], ?]]]
    ): F[Validated[NonEmptyList[M], L]] =
      l.toList.traverse(_.map(_.pure[F]))
        .map(_.sequence)
        .map(_.map(_.foldLeft(NonEmptyList.one(M.empty))((acc, v) => acc /+/ v)))
        .map(_.map(_.map(l.foldLeft(_)((acc, v) => v :: acc))))
  }
}

/**
  * A typeclass for folding an HList of [[ValidatedNel]]s into a single [[ValidatedNel]].
  *
  * @tparam F The type of the [[ValidatedNel]]s.
  * @tparam E The type of the errors in the [[ValidatedNel]]s.
  */
trait ValidatedNelFold[F[_], E] {
  def fold[L <: HList](l: L)(implicit
      toTraversable: ToTraversable.Aux[L, List, F[ValidatedNel[E, ?]]]
  ): F[ValidatedNel[E, L]]
}

object ValidatedNelFold {
  def apply[F[_], E](implicit ev: ValidatedNelFold[F, E]): ValidatedNelFold[F, E] = ev

  implicit def validatedNelFold[F[_], E](implicit
      F: Monad[F]
  ): ValidatedNelFold[F, E] = new ValidatedNelFold[F, E] {
    def fold[L <: HList](l: L)(implicit
        toTraversable: ToTraversable.Aux[L, List, F[ValidatedNel[E, ?]]]
    ): F[ValidatedNel[E, L]] =
      l.toList.traverse(_.map(_.pure[F]))
        .map(_.sequence)
        .map(_.map(_.foldLeft(NonEmptyList.one(List.empty[E]))((acc, v) => acc ++ v)))
        .map(_.map(_.map(l.foldLeft(_)((acc, v) => v :: acc))))
  }
}

/**
  * A typeclass for folding an HList of [[Either]]s into a single [[Either]].
  *
  * @tparam F The type of the [[Either]]s.
  * @tparam E The type of the errors in the [[Either]]s.
  */
trait EitherFold[F[_], E] {
  def fold[L <: HList](l: L)(implicit
      toTraversable: ToTraversable.Aux[L, List, F[Either[E, ?]]]
  ): F[Either[E, L]]
}

object EitherFold {
  def apply[F[_], E](implicit ev: EitherFold[F, E]): EitherFold[F, E] = ev

  implicit def eitherFold[F[_], E](implicit
      F: Monad[F]
  ): EitherFold[F, E] = new EitherFold[F, E] {
    def fold[L <: HList](l: L)(implicit
        toTraversable: ToTraversable.Aux[L, List, F[Either[E, ?]]]
    ): F[Either[E, L]] =
      l.toList.traverse(_.map(_.pure[F]))
        .map(_.sequence)
        .map(_.map(_.foldLeft(Right(List.empty[E]): Either[E, List[E]])((acc, v) => acc.flatMap(acc => v.map(_ :: acc)))))
        .map(_.map(_.map(l.foldLeft(_)((acc, v) => v :: acc))))
  }
}

/**
  * A typeclass for folding an HList of [[Option]]s into a single [[Option]].
  *
  * @tparam F The type of the [[Option]]s.
  */
trait OptionFold[F[_]] {
  def fold[L <: HList](l: L)(implicit
      toTraversable: ToTraversable.Aux[L, List, F[Option[?]]]
  ): F[Option[L]]
}

object OptionFold {
  def apply[F[_]](implicit ev: OptionFold[F]): OptionFold[F] = ev

  implicit def optionFold[F[_]](implicit
      F: Monad[F]
