package main

import (
	"fmt"
	"strings"
)

func main() {
	fmt.Println("Halo, saya adalah chatbot. Apa yang bisa saya bantu?")

	var input string
	fmt.Scanln(&input)

	input = strings.ToLower(input)

	if input == "apa yang bisa kamu bantu?" {
		fmt.Println("Saya bisa membantu Anda dengan berbagai hal, seperti menjawab pertanyaan Anda, memberikan informasi, dan lain-lain.)
	} else if input == "apa yang bisa kamu lakukan?" {
		fmt.Println("Saya bisa melakukan banyak hal, seperti menjawab pertanyaan Anda, memberikan informasi, dan lain-lain.)
	} else {
		fmt.Println("Maaf, saya tidak mengerti.)
	}
}"

